// import { NgForm } from '@angular/forms';
// import { UpdateComponent } from './employee/update/update.component';

@NgModule({
  declarations: [
    AppComponent
  ],
  imports: [
    BrowserModule,
    // EmployeeModule,
    AppRoutingModule,
    ReactiveFormsModule,
    HttpClientModule,
    FormsModule,
    // UpdateComponent
  ],
  providers: [],
  bootstrap: [AppComponent]
})
